import { styled } from "styled-components";

export const Lista = styled.ul`
list-style: none;
margin: 0;
padding: 0;
display: flex;
justify-content: center;
align-items: center;
`;

export const ItemLi = styled.li`
margin-left: 0.5rem;
margin-right: 0.5rem;
font-size: 17px;
font-family: 'Poppins', sans-serif;
font-weight: 600;
padding: 0px;
display: list-item;
color: white;
`;
